import styled from 'styled-components';

const Header = () => {
  return (
    <HeaderWrapper>
      <span>Glog</span>
    </HeaderWrapper>
  );
};

export default Header;

const HeaderWrapper = styled.div`
  height: 3.5rem;
  background-color: black;
  color: white;
  text-align: center;
  line-height: 3rem;
`;
